import Board from './Board'
import Card from 'react-bootstrap/Card';

const Boards = ({ boards }) => {
    return (
        <>
        <Card border="info" style={{ width: '30rem'}}>
            <Card.Header>
                <p>Boards</p>
            </Card.Header>
            <Card.Body>
                {boards.map((board, index) => (
                    <Board key={index} board={board} />
                ))}
            </Card.Body>   
        </Card>
        </>
    )
}

export default Boards
